import { BrowserRouter } from 'react-router-dom';
import LayoutPage from './layouts/LayoutPage';
import NotFoundPage from './pages/NotFoundPage.css/NotFoundPage';
import Router from './routes/Router';


function App() {


  return (
    <div className='container'>
